import React, { useState } from "react";
import matricielleConst from "./Const/matriciel";

class ImageClass extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            image:Object
        }
    }

    render(){
        return(
            <div class="card" style="width: 18rem;">
                <img src={this.state.image.url} className="card-img-top" alt={this.state.image.nom}/>
                <div className="card-body">
                    <h5 class="card-title">{this.state.image.nom}</h5>
                    <a href={this.state.image.nom} class="btn btn-primary">Go somewhere</a>
                </div>
            </div>
        )
    }
}

